import React, {useState} from 'react';
import logo from "./logo.svg";
import "./App.css";

function App() {
    let contents = [
        { title: "title1", date: "content1" },
        { title: "title2", date: "content2" },
        { title: "title3", date: "content3" },
        { title: "title4", date: "content4" },
        { title: "title5", date: "content5" },
    ];

    let [title,modify] = useState('이것은 useState입니다.');

    return (
        <div className="App">
            <header className="navbar bg-dark navbar-dark fixed-top sticky-top">
                <div className="navbar-header max-width">
                    <a href="#" class="navbar-brand">
                        Logo
                    </a>
                </div>
            </header>
            <div className="container mt-5">
                {contents.map((contents, index) => (
                    <div className="content-item">
                        <div className="content-wrap">
                          <div className="content-title">{contents.title}</div>
                          <div className="content-content">{contents.content}</div>
                        </div>
                        <hr />
                    </div>
                ))}
            </div>
        </div>
    );
}

export default App;
